import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import SkygateLogo from '../logos/SkygateLogo';
import SkygateLogisticsLogo from '../logos/SkygateLogisticsLogo';
import SkygateTravelLogo from '../logos/SkygateTravelLogo';

const Footer = () => {
  const location = useLocation();

  // Get the appropriate logo component based on current page
  const getCurrentLogo = () => {
    const path = location.pathname;
    if (path.startsWith('/logistics')) {
      return <SkygateLogisticsLogo width={160} height={45} />;
    } else if (path.startsWith('/travel')) {
      return <SkygateTravelLogo width={160} height={45} />;
    } else {
      return <SkygateLogo width={160} height={45} />;
    }
  };

  // Fixed footer colors - consistent across all pages
  const footerColors = {
    primaryColor: '#5e716a',
    lightColor: '#f0f3f2',
    gradient: 'from-gray-900 via-gray-800 to-gray-900'
  };

  return (
    <footer className={`bg-gradient-to-br ${footerColors.gradient} text-white relative overflow-hidden`}>
      {/* Fixed background elements */}
      <div 
        className="absolute inset-0 opacity-5"
        style={{
          background: `linear-gradient(135deg, ${footerColors.primaryColor}15, ${footerColors.primaryColor}05)`
        }}
      ></div>

      {/* Floating Elements */}
      <div className="absolute inset-0 overflow-hidden">
        <div 
          className="absolute -top-20 -right-20 w-40 h-40 rounded-full blur-3xl animate-float-slow"
          style={{ backgroundColor: `${footerColors.primaryColor}20` }}
        ></div>
        <div 
          className="absolute -bottom-20 -left-20 w-40 h-40 rounded-full blur-3xl animate-float-slow"
          style={{ 
            backgroundColor: `${footerColors.primaryColor}20`,
            animationDelay: '2s'
          }}
        ></div>
      </div>

      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-16 relative z-10">
        <div className="grid grid-cols-1 md:grid-cols-3 gap-12">
          {/* Company Info */}
          <div className="md:col-span-1">
            <div className="mb-6">
              {getCurrentLogo()}
            </div>
            <p className="text-gray-300 mb-6 leading-relaxed">
              Your service. Our promise. Connecting business worldwide through innovative solutions.
            </p>
            <div className="flex space-x-4">
              <a href="https://facebook.com/SkygateGroupOfficial" target="_blank" rel="noopener noreferrer" className="text-gray-400 hover:text-white transition-colors duration-300">
                <span className="sr-only">Facebook</span>
                <svg className="h-6 w-6" fill="currentColor" viewBox="0 0 24 24">
                  <path d="M24 12.073c0-6.627-5.373-12-12-12s-12 5.373-12 12c0 5.99 4.388 10.954 10.125 11.854v-8.385H7.078v-3.47h3.047V9.43c0-3.007 1.792-4.669 4.533-4.669 1.312 0 2.686.235 2.686.235v2.953H15.83c-1.491 0-1.956.925-1.956 1.874v2.25h3.328l-.532 3.47h-2.796v8.385C19.612 23.027 24 18.062 24 12.073z"/>
                </svg>
              </a>
              <a href="https://instagram.com/skygategroup" target="_blank" rel="noopener noreferrer" className="text-gray-400 hover:text-white transition-colors duration-300">
                <span className="sr-only">Instagram</span>
                <svg className="h-6 w-6" fill="currentColor" viewBox="0 0 24 24">
                  <path d="M12.017 0C5.396 0 .029 5.367.029 11.987c0 6.62 5.367 11.987 11.988 11.987s11.987-5.367 11.987-11.987C24.004 5.367 18.637.001 12.017.001zM8.449 16.988c-1.297 0-2.448-.49-3.323-1.297C4.198 14.895 3.708 13.744 3.708 12.447s.49-2.448 1.418-3.323c.875-.807 2.026-1.297 3.323-1.297s2.448.49 3.323 1.297c.928.875 1.418 2.026 1.418 3.323s-.49 2.448-1.418 3.244c-.875.807-2.026 1.297-3.323 1.297zm7.83-9.281c-.49 0-.928-.175-1.297-.49-.368-.315-.49-.753-.49-1.243s.122-.928.49-1.243c.369-.315.807-.49 1.297-.49s.928.175 1.297.49c.368.315.49.753.49 1.243s-.122.928-.49 1.243c-.369.315-.807.49-1.297.49z"/>
                </svg>
              </a>
            </div>
          </div>

          {/* Services */}
          <div>
            <h3 className="text-lg font-semibold mb-6 text-white">Our Services</h3>
            <ul className="space-y-3">
              <li>
                <Link 
                  to="/logistics" 
                  className="text-gray-300 hover:text-white transition-colors duration-300 block"
                >
                  Skygate Logistics
                </Link>
              </li>
              <li>
                <Link 
                  to="/travel" 
                  className="text-gray-300 hover:text-white transition-colors duration-300 block"
                >
                  Skygate Travel
                </Link>
              </li>
            </ul>
          </div>

          {/* Contact Info */}
          <div>
            <h3 className="text-lg font-semibold mb-6 text-white">Contact</h3>
            <div className="space-y-3 text-gray-300">
              <p>Villa No. 297, 1 Italian Village Rd</p>
              <p>Erbil, Erbil Governorate</p>
              <p className="mt-4">
                <a href="tel:+12345678900" className="hover:text-white transition-colors duration-300">
                  +1 (234) 567-8900
                </a>
              </p>
              <p>
                <a href="mailto:skygategroup@gmail.com" className="hover:text-white transition-colors duration-300">
                  skygategroup@gmail.com
                </a>
              </p>
            </div>
          </div>
        </div>

        <div className="border-t border-white/10 mt-12 pt-8">
          <div className="flex flex-col md:flex-row justify-between items-center">
            <p className="text-gray-400 text-sm">
              © 2024 Skygate Group. All rights reserved.
            </p>
            <div className="flex space-x-6 mt-4 md:mt-0">
              <Link to="/about" className="text-gray-400 hover:text-white text-sm transition-colors duration-300">
                About Us
              </Link>
              <Link to="/contact" className="text-gray-400 hover:text-white text-sm transition-colors duration-300">
                Contact
              </Link>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
